insert into mm_catalog_subgroup_item_t   
select mm_catalog_subgroup_item_s.nextval catalog_subgroup_item_id, 
         SYS_GUID() obj_id, 
         '1' ver_nbr,  
         g.catalog_item_id, 
         a.catalog_subgroup_id, 
         'Y' actv_ind, 
         CURRENT_DATE last_update_dt
from (Select ts.CATALOG_GROUP_CD as CATALOG_GROUP_CD,
             ts.CATALOG_SUBGROUP_CD as CATALOG_SUBGROUP_CD,
             ts.CATALOG_SUBGROUP_ID as CATALOG_SUBGROUP_ID,
             ts.CATALOG_SUBGROUP_DESC as CATALOG_SUBGROUP_DESC,
             ts.PRIOR_CATALOG_SUBGROUP_ID as PRIOR_CATALOG_SUBGROUP_ID
      from mm_catalog_subgroup_t ts
      where nvl(ts.prior_catalog_subgroup_id,0) > 0
      order by catalog_group_cd, CATALOG_SUBGROUP_CD) a
join (Select ts.CATALOG_GROUP_CD as CATALOG_GROUP_CD,
             ts.CATALOG_SUBGROUP_CD as CATALOG_SUBGROUP_CD,
             ts.CATALOG_SUBGROUP_ID as CATALOG_SUBGROUP_ID,
             ti.catalog_item_id as CATALOG_ITEM_ID,
             t.catalog_desc as CATALOG_DESC
      from mm_catalog_subgroup_t ts
      join mm_catalog_subgroup_item_t ti
        on ti.catalog_subgroup_id = ts.catalog_subgroup_id
      join mm_catalog_item_t t
        on t.catalog_item_id = ti.catalog_item_id
      where nvl(ts.prior_catalog_subgroup_id,0) = 0) g
   on g.catalog_subgroup_id = a.prior_catalog_subgroup_id
where UPPER(g.catalog_desc) like '%'||UPPER(a.catalog_subgroup_desc)||'%' 
;

Commit;

insert into mm_catalog_subgroup_item_t   
select mm_catalog_subgroup_item_s.nextval catalog_subgroup_item_id, 
         SYS_GUID() obj_id, 
         '1' ver_nbr,  
         g.catalog_item_id, 
         a.catalog_subgroup_id, 
         'Y' actv_ind, 
         CURRENT_DATE last_update_dt
from (Select ts.CATALOG_GROUP_CD as CATALOG_GROUP_CD,
             ts.CATALOG_SUBGROUP_CD as CATALOG_SUBGROUP_CD,
             ts.CATALOG_SUBGROUP_ID as CATALOG_SUBGROUP_ID,
             ts.CATALOG_SUBGROUP_DESC as CATALOG_SUBGROUP_DESC,
             ts.PRIOR_CATALOG_SUBGROUP_ID as PRIOR_CATALOG_SUBGROUP_ID
      from mm_catalog_subgroup_t ts
      where nvl(ts.prior_catalog_subgroup_id,0) > 0
      order by catalog_group_cd, CATALOG_SUBGROUP_CD) a
join (Select ts.CATALOG_GROUP_CD as CATALOG_GROUP_CD,
             ts.CATALOG_SUBGROUP_CD as CATALOG_SUBGROUP_CD,
             ts.CATALOG_SUBGROUP_ID as CATALOG_SUBGROUP_ID,
             ti.catalog_item_id as CATALOG_ITEM_ID,
             t.catalog_desc as CATALOG_DESC
      from mm_catalog_subgroup_t ts
      join mm_catalog_subgroup_item_t ti
        on ti.catalog_subgroup_id = ts.catalog_subgroup_id
      join mm_catalog_item_t t
        on t.catalog_item_id = ti.catalog_item_id
      where nvl(ts.prior_catalog_subgroup_id,0) > 0) g
   on g.catalog_subgroup_id = a.prior_catalog_subgroup_id
where UPPER(g.catalog_desc) like '%'||UPPER(a.catalog_subgroup_desc)||'%' 
;
